import React from 'react';
import './transaccion.css';

function Transaccion(props){
	return (
		<div className="transaccion">
			<div className="textotransaccion">
				C&oacute;digo:
			</div>
			<div className="valortranzaccion">
				{props.codigo}
			</div>
			<div className="textotransaccion">
				Grupo:
			</div>
			<div className="valortranzaccion">
				{props.grupo}
			</div>
			<div className="textotransaccion">
				Descripci&oacute;n:
			</div>
			<div className="valortranzaccion">
				{props.descripcion}
			</div>
			<div className="buttonacceder">
				<svg xmlns="http://www.w3.org/2000/svg" width="40" height="40" fill="currentColor" class="bi bi-arrow-right-square-fill" viewBox="0 0 16 16">
				  <path d="M0 14a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V2a2 2 0 0 0-2-2H2a2 2 0 0 0-2 2zm4.5-6.5h5.793L8.146 5.354a.5.5 0 1 1 .708-.708l3 3a.5.5 0 0 1 0 .708l-3 3a.5.5 0 0 1-.708-.708L10.293 8.5H4.5a.5.5 0 0 1 0-1"/>
				</svg>
			</div>
		</div>
		);
}

export {Transaccion};
